            d1 = getDistance(p1, p2),
            d2 = getDistance(p2, p3),
            d3 = getDistance(p3, p4),
            d4 = getDistance(p4, p1);

            let avgSize1 = (d1 + d3) / 2
            let avgSize2 = (d2 + d4) / 2
            
            if(avgSize1 > avgSize2){
                return {
                    width: avgSize1, 
                    height: avgSize2
                }
            }
            else{
                return {
                    width: avgSize2, 
                    height: avgSize1
                }
            }
